class EmployeeService {
    static addEmployee(employeeData) {
      // Simulate an API call to add an employee
      return new Promise((resolve, reject) => {
        setTimeout(() => {
          console.log('Employee added:', employeeData);
          resolve();
        }, 1000);
      });
    }
  }

  export default EmployeeService;
